#define EMBEDDED_SCW_COUNT 25

// Load all embedded SCWs into the synth's wavetable slots
// Call this instead of loadSCW() calls
static int loadEmbeddedSCWs(void) {
    int loaded = 0;
    for (int i = 0; i < EMBEDDED_SCW_COUNT && scwCount < SCW_MAX_SLOTS; i++) {
        const EmbeddedSCW* e = &embeddedSCWs[i];
        SCWTable* table = &scwTables[scwCount];
        
        // Copy data
        int size = e->size;
        if (size > SCW_MAX_SIZE) size = SCW_MAX_SIZE;
        for (int j = 0; j < size; j++) {
            table->data[j] = e->data[j];
        }
        table->size = size;
        table->loaded = true;
        table->name = e->name;
        scwCount++;
        loaded++;
    }
    return loaded;
}

